<h1 class="title toc-ignore">Homework0</h1>
<h4 class="author"><em>財金四 B02703029 許祐瑄</em></h4>
<h4 class="date"><em>2017/2/24</em></h4>

</div>


<p>1、提案計畫：台大盜竊點地圖</p>
<p>2、提案動機：台大校園屬於開放空間，對於外校人士幾乎沒有任何管制，幾乎所有人都能來到校園裡面，這也造成學生在運動或離開教室時，一個空擋將隨身行李留在教室或運動場旁，使得校外不明人士可能趁機偷取貴重物品，造成損失。因此希望能透過建置台大校園竊盜點地圖，讓台大學生知道哪些地點必須要多加注意，並且也讓學校可以針對這些地點加強巡邏或設置監視器。</p>
<p>3、所需資料及套件：台大過去竊盜通報紀錄、學校地圖資訊、台大監視器地圖、ggplot2、ggmap、googleVis</p>

  $('tr.header').parent('thead').parent('table').addClass('table table-condensed');
}
$(document).ready(function () {
  bootstrapStylePandocTables();
});
